css:
.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 0.5rem 1.5rem;
  text-align: center;
  font-weight: 600;
  color: #aaaebd;
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid #2e303c;
  background-color: #3b3e4d;
}
.github-tab-icon {
  color: #6c6f7e;
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: .4em;
}
.github-tab-count {
  display: inline-block;
  background-color: #515564;
  border-radius: 4px;
  padding: 0 .25em;
  margin-left: 0.5rem;
}
.github-tab.react-tabs__tab--selected {
  color: #f9f9fb;
  box-shadow: 0 1px 0 #484c5f;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: #cfd3e2;
}
